import "../CSS/DisplayBreakfastItems.css";

function DisplayBreakfastItems({item}) {

    return (
        <div className="breakfast-item list-group-item list-group-item-action list-group-item-light justify-content-center w-100">
            <h2>{item.name}</h2>
            <h3>{item.calories}</h3>
        </div>

    )
}

export default DisplayBreakfastItems;
